import React from 'react'
import Manifest from './manifest.json'

const TextBlocks = () => {
    var text = Manifest.main
    return(
    <div className='space-y-5'>
        {text.split('/n').map((i,key) => {
            return <div key={key}>{i}</div>;
            })}
        </div>
    )
}

const SectionContent = () => {
    return (
    <div className='grid md:grid-flow-col text-black p-7 md:gap-x-10'>
        <div className='grid grid-flow-row mb-9'>
            <div className='font-extrabold text-sm opacity-30 mb-9'>{Manifest.heading}</div>
            <div className=''>
                <div className='font-extrabold text-3xl mb-3 opacity-90 md:text-5xl md:mb-7'>{Manifest.title}</div>
                <div className='font-normal text-base leading-snug opacity-90 md:text-base'><b>STAGELINK </b>{Manifest.main[0]['main']}</div>
            </div>
        </div>
        <div className='space-y-4 bg-white ring-1 ring-gray-300 shadow rounded-xl p-5'>
            <div className='mb-3'>
                <div className='font-extrabold text-base leading-relaxed mb-3 opacity-90 md:text-lg'>THE PROBLEM</div>
                <div className='font-normal text-base leading-snug mb-3 opacity-80'>{Manifest.main[1]['main']}</div>
            </div>
            <div>
                <div className='font-extrabold text-base leading-relaxed mb-3 opacity-90 md:text-lg'>THE SOLUTION</div>
                <div className='font-normal text-base leading-snug mb-3 opacity-80'>{Manifest.main[2]['main']}</div>
            </div>
        </div>
    </div>
    )
}

export default SectionContent
